import { AUTH } from '../constants/actionTypes';
import * as api from '../api/index';

export const signin = (formData, navigate) => async (dispatch) => {
    try {
        // for sign in

        navigate('/');
    } catch (error) {
        console.log(error)
    }
}



export const signup = (formData, navigate) => async (dispatch) => {
    try {
        // for sign up

        navigate('/');
    } catch (error) {
        console.log(error)
    }
}
